// Inside your index.js or App.js file

import React from 'react';
import ReactDOM from 'react-dom';

// Import styles
import './client/assets/css/bootstrap.min.css';
import './client/assets/css/other.css';

// Import scripts
import './client/assets/js/jquery.min.js';
import './client/assets/js/popper.min.js';
import './client/assets/js/core/bootstrap.min.js';
import './client/assets/js/core/perfect-scrollbar.jquery.min.js';
import './client/assets/js/to/chartjs.min.js';
import './client/assets/js/to/bootstrap-notify.js';
import './client/assets/js/public/paper-dashboard.min.js?v=2.0.1';

import App from './client/App'; // Adjust the path based on your project structure

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
